package com.example.studentapp.database.topUsersDatabaseimport androidx.room.ColumnInfoimport androidx.room.Entityimport androidx.room.PrimaryKey@Entity(tableName = "topUser")class TopUserData(    @ColumnInfo(name = "userName") val userName: String?,    @ColumnInfo(name = "userScore") val userScore: String?,    @ColumnInfo(name = "email") val email: String?,    @ColumnInfo(name = "userImgUri") val userImgUri: String?,    @ColumnInfo(name = "idUser") val idUser: String?,    ) {    @PrimaryKey(autoGenerate = true)    var id: Int? = null    override fun equals(other: Any?): Boolean {        return super.equals(other)    }}